if (favSeries=== 'netflix'){
    return(
        <Card
         key ={Sdata[1].id}
         imgsrc={Sdata[1].imgsrc}
        title={Sdata[1].title}
        sname={Sdata[1].sname}
        link={Sdata[1].link}
       />
 
    );

}else{

}
}



 
ReactDOM.render(
    <>
    <h1  className= "heading_style">List Of Top 5 Netflix Webseries</h1>
   
   
   </>,document.getElementById("root"))
